import React, { Component } from 'react';
import { Fragment } from 'react'
import "../style.css"



class FeaturedImage extends Component {
    constructor(props){
        super(props);
        this.state = {
            featuredImgUrl: ''
        }
    }

    render() {
        return(
            <Fragment>
                <img src={this.props.featuredImgUrl} />

            </Fragment>
        );
    }
}
export default FeaturedImage;
